import React from 'react'
import Bar from './Bar';
import Img from './Img'

const Home = props => {

    return (
        <div>
            <Bar />
            <Img />
            <br/>

            <iframe width="560" height="315" src="https://www.youtube.com/embed/mFKoeai0y8s" 
            frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>

            <div>
            </div>
        </div>
    )
}

export default Home;
